import React from "react";
import ToDoListFram from "./ToDoListFram";

const T0DoListItems = () => {
  const [showItems, showNewItems] = useState([]);

  return (
    <>
      {showItems.map((curValue) => {
        return (
          <>
            <div className="delet__btn">
              <i className="fa-solid fa-trash"></i>
              <li> {curValue} </li>
            </div>
          </>
        );
      })}
    </>
  );
};

export default T0DoListItems;
